"use client";
import { FC } from "react";
import Image from "next/image";
import Link from "next/link";
import { useTranslation } from "react-i18next";
import { DogButton } from "./DogButton";
import { usePathname } from "next/navigation";

interface OneDogProps {
  breed: string;
  name: string;
  image: string;
  page: string;
  id: string;
  dataDogs?: any[];
}

export const OneDog: FC<OneDogProps> = ({
  breed,
  name,
  image,
  page,
  id,
  dataDogs = [],
}) => {
  const router = usePathname();
  const { t } = useTranslation();
  const urlPath =
    page === "home"
      ? `${router}/alldogs/${String(id)}`
      : `${router}/${String(id)}`;

  return (
    <li className="hover:shadow-md hover:shadow-gray-500 dark:hover:shadow-white   transition duration-300">
      <Link href={urlPath}>
        <div className="h-[360px] relative">
          <Image
            priority={true}
            placeholder="blur"
            blurDataURL="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mNkYPhfDwAChwGA60e6kgAAAABJRU5ErkJggg=="
            // placeholder="data:image/jpeg;base64,"
            src={image}
            alt={name}
            fill
            sizes="100%"
            style={{
              objectFit: "cover",
            }}
          />
        </div>
      </Link>
      <div className="flex flex-row justify-between p-[10px]">
        <div>
          <p>
            {t("name")}: {name}
          </p>
          <p>
            {t("breed")}: {breed}
          </p>
        </div>

        <DogButton
          dataDogs={dataDogs}
          page={page}
          id={id}
          dog={{ id, breed, name, image }}
        >
          {page === "home" ? "Add" : "Delete"}
        </DogButton>
      </div>
    </li>
  );
};
